import React from "react";
import { useParams } from "react-router-dom";

import Helmet from "../components/Helmet";

function Blog(props) {
	const slug = useParams();
  var blog;

	return (
		<Helmet title="Blog">
			<div className="blog">
				<div className="blog__cover-image">
					<div className="blog__timestamp"></div>
				</div>
				.
			</div>
		</Helmet>
	);
}

export default Blog;
